import './css/colors.css'
import './css/style.css'

import Navbar from './navbar'
import Load from './load'
import Container from './container'

import axios from 'axios'

function Home() {
    var fun = () => {
        axios.get(localStorage.getItem('url') + '/about.json')
        .then(function (res) {
            console.log(res.data);
            // const temp = document.getElementById('content')
            // console.log(temp)
            // temp.innerHTML = <Container />
            // console.log(<Container />)
            return <Container />
        })
        .catch(function (err) {
            console.log(err)
            return <Load />
        });
        return <Load />
    }

    return (
        <div className="App">
            <Navbar />
            <div id="content">
                {fun()}
            </div>
        </div>
    );
}

export default Home
